fields.description:
Мультивалютный вклад DEPOSITUM позволяет хранить и приумножать деньги одновременно в трех валютах: тенге, долларах США и евро.
Преимущества:возможность дистанционно проводить конвертацию денег в рамках счетов мультивалютного вклада без комиссий с использованием интернет-банкинга Банка:
– без ограничения максимальной суммы конвертации;
